  color: blue;

  p {
    font-size: 1rem;
    color: red;
  }
`;

function App() {
  return (
    <Title>
      Styled Components
      <p>
        Lorem ipsum dolor sit amet consectetur, adipisicing elit. Pariatur quod
        eaque nisi delectus dolores facere laudantium voluptatibus officia
        corporis fuga molestias, quibusdam rerum porro repudiandae eius eligendi
        non consequatur fugit.
      </p>
    </Title>
  );
}

export default App;
